import React from 'react';
import { Form } from 'react-bootstrap';

class Login extends React.Component<any> {
    constructor(props: any) {
        super(props);
    }

    render() {
        return (
            <Form>
                <Form.Control size="lg" type="text" placeholder="Email" />
            </Form>
            
        );
    }
}

export default Login;
